import javax.swing.*;
public class Bucle_for {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num = Integer.parseInt(JOptionPane.showInputDialog(" Digite cuantas veces quiere que se repita"));
		
		for(int i=0;i<num;i++) {
			System.out.println("Jhorman Botello "+(i+1));
		}

	}

}
